import React, { Component } from 'react'

class Customers extends Component {
    render() {
        return(
            <div className="container">
                <h1>this is the customer page</h1>
                <div className="col-md-6">
                    <table>
                        <thead>
                            <th>Name</th>
                            <th>Vehicle</th>
                            <th>Email</th>
                        </thead>
                            {
                                this.props.users.map((user, i) =>
                                <tbody key={i}>
                                    <tr><td></td></tr>
                                    <tr><td></td></tr>
                                    <tr></tr>
                                </tbody>
                                )
                            }
                    </table>
                </div>
            </div>
        )
    }
}

export default Customers;
